import tensorflow as tf
from tensorflow.keras.datasets import fashion_mnist
from tensorflow.keras.layers import Conv2D, Dropout, MaxPooling2D, Flatten, Dense ,Activation ,BatchNormalization
from tensorflow.keras.callbacks import ModelCheckpoint
# Helper libraries
import numpy as np
import matplotlib.pyplot as plt

"""# Arquitectura modelo de convolucion


![image.png](data:image/png;base64,)

### La data que se va a ocupar se trata de imagenes de distintos tipos de ropa y nuetra red tendra que identificar a que prenda o accesorio corresponde la imagen
"""

(train_images, train_labels), (test_images, test_labels) = fashion_mnist.load_data()

train_images.shape # Son 60,000 imagenes que de 28 x 28 pixeles

plt.imshow(train_images[99])

"""# Limpieza de datos"""

train_images = train_images.astype('float32') / 255 # Se divide entre 255 porque el valor de un pixel es de 1 a 255 y al dividirlo tendriamos valores de 0 a 1 , y asi trabaje mejor la red neuronal
test_images = test_images.astype('float32') / 255

train_images = train_images.reshape(train_images.shape[0], 28, 28, 1) # El 1 al final es el canal del color
test_images = test_images.reshape(test_images.shape[0], 28, 28, 1)

train_labels[0] # El valor en la posicion 0 es clasificado como 9

train_labels = tf.keras.utils.to_categorical(train_labels, 10) # Es 10 porque solo tenemos 10 posibles valores de salida
test_labels = tf.keras.utils.to_categorical(test_labels, 10)

train_labels[0] # Lo que hizo la funcion to_categorical fue converstir el valor escalar a un arreglo binario en donde habra un 1 en la poscion que corrsponde al valor escalar

"""# Creacion del modelo

1er capa Convolucion

En esta capa se da el proceso de convolucion que no es mas que una operacion matricial entre el kernel(matriz de pesos) y la imagen con el proposito de detectar patrones en los datos como los bordes , texturas o formas

Hiperparametros de la capa de convolucion

- filters : te dice la cantidad de kernels
 - kernel_size : te dice el tamano de la matriz
 - padding : Es un margen que se le agrega a ala imagen para que al  momento de realizar la operacion de convolucion la imagen resultante no resduzca su tamano
 - stride : Es el tamano del paso en cada convolucion.Entre mas grande sea el paso menor sera la imagen resultante

![image.png](data:image/png;base64,)

 2da capa Pooling

 Esta capa se encarga de disminuir la complejidad de la red neuronal para uqe sea mas facil de procesar y gastar menos recursos de computo.Se trata de otra matriz(kernel) que realiza el recorrido en la mtriz que fue la salida de la operacion de convolucion y obtiene el maximo o el promedio que mejor representa al kernel. Se va a reducir el ancho y largo de la imagen pero no las propiedades.Sirve para eliminar el ruido de los demas pixeles

 ![image.png](data:image/png;base64,)
"""

model = tf.keras.Sequential()
model.add(Conv2D(filters=64 , kernel_size=2,padding='same',activation='relu',input_shape=(28,28,1)))
model.add(MaxPooling2D(pool_size=2))
model.add(Dropout(0.3))
model.add(Conv2D(filters=32,kernel_size=2 , padding = 'same', activation = 'relu'))
model.add(MaxPooling2D(pool_size=2))
model.add(Dropout(0.3))
model.add(Flatten()) # LLeva todo el arreglo a una sola dimension
model.add(Dense(256, activation='relu'))
model.add(Dropout(0.5))
model.add(Dense(10, activation='softmax'))
# Take a look at the model summary
model.summary()

"""## Compilando Red Neuronal"""

model.compile(loss='categorical_crossentropy',
             optimizer='rmsprop',
             metrics=['accuracy'])

"""## Entrenando la Red"""

model.fit(train_images,train_labels, batch_size=64,epochs=10)

"""## Analisis de Resultados"""

score = model.evaluate(test_images, test_labels, verbose=0)

score

"""### Callbacks

#### EarlyStopping

Su funcion principal radica en que va a monitorear la metrica que le indiquemos y si la metrica no aumneta en x epocas el entrenamiento se detendra
"""

# monitor sera la metrica en la cual estara haciendo el monitoreo y pateince es el limite de epocas permitidas para cuando la metrica ya no aumenta
early = tf.keras.callbacks.EarlyStopping(monitor='accuracy',patience=1)

model.fit(train_images,train_labels, batch_size=64,epochs=10,callbacks=[early])

model.evaluate(test_images, test_labels, verbose=0)

"""#### CheckPoint

Este callback lo que hace es guardar en un archivo con los pesos que tuvieron mejor accuracy o la metica definida una vez guardados esos peso se genera un nuevo modelo y le pasamos los pesos para que tenga mejor evaluacion y rendimiento gracias a los mejores pesos
"""

from google.colab import drive
drive.mount('/content/drive')

checkpoint = ModelCheckpoint('/content/drive/MyDrive/Leccion Python/Deep_Learning/best_model.h5',monitor='accuracy',verbose=1,save_best_only=True)

from keras.models import clone_model # para copiar el elemento y no solo la direccion de memoria
model2 = clone_model(model)

model2.load_weights('/content/drive/MyDrive/Leccion Python/Deep_Learning/best_model.h5')

model2.evaluate(test_images, test_labels, verbose=0)

"""La **optimización de un modelo de clasificación** en redes neuronales profundas implica mejorar el rendimiento del modelo ajustando tanto su arquitectura como los parámetros de entrenamiento. Los principales componentes de la optimización incluyen el ajuste de hiperparámetros, la selección de funciones de pérdida, el uso adecuado de optimizadores, la regularización y la mejora en el manejo de los datos.

### 1. **Componentes principales de la optimización**

- **Función de pérdida**: La función de pérdida mide qué tan mal está haciendo el modelo con respecto a las predicciones. En problemas de clasificación, una función de pérdida común es la **entropía cruzada categórica** (categorical\_crossentropy) cuando las etiquetas son one-hot encoded o **entropía cruzada escasa** (sparse\_categorical\_crossentropy) cuando las etiquetas son enteros.

- **Optimizador**: Los optimizadores controlan cómo se ajustan los pesos de la red basándose en la función de pérdida. Los optimizadores comunes incluyen:

- **SGD (Stochastic Gradient Descent)**: Una versión de gradiente descendente que ajusta los pesos después de evaluar cada mini-lote de datos.

- **Adam**: Un optimizador muy utilizado por su capacidad de adaptarse a las tasas de aprendizaje y manejar mejor los problemas de optimización complicados.


- **Tasa de aprendizaje**: Controla la magnitud de los ajustes de los pesos en cada iteración. Una tasa de aprendizaje muy alta puede hacer que el modelo no converja y una tasa muy baja puede hacer que el proceso sea demasiado lento.

- **Regularización**: Se utiliza para evitar el **overfitting**, que ocurre cuando el modelo se ajusta demasiado a los datos de entrenamiento y no generaliza bien. Las técnicas comunes de regularización incluyen:

- **Dropout**: Apaga neuronas de manera aleatoria durante el entrenamiento.

- **L2 Regularization**: Penaliza los pesos muy grandes.

- **Ajuste de hiperparámetros**: Involucra la experimentación con parámetros como la cantidad de capas, número de neuronas, tasa de aprendizaje, tamaño de lote, etc., para mejorar el rendimiento del modelo.

- **Data Augmentation**: Se utiliza para ampliar artificialmente el conjunto de datos mediante transformaciones aleatorias como rotación, escala o traslación de imágenes.

### 2. **Técnicas avanzadas de optimización**

- **Early Stopping**: Detiene el entrenamiento cuando el rendimiento en los datos de validación deja de mejorar, evitando así el sobreajuste.

- **Reducción de la tasa de aprendizaje**: Reduce la tasa de aprendizaje cuando el rendimiento se estabiliza, permitiendo que el modelo converja más suavemente.

- **Normalización de datos**: Es fundamental asegurarse de que los datos de entrada estén correctamente escalados o normalizados, lo que ayuda al modelo a converger más rápido
"""